Area.create!(:name=>'Colaba',:comment=>'This includes the localities of  Kalanagar, Kurla and Bandra Station East which are close to the prominent Bandra Kurla Complex (BKC). BKC is now home to some of India\'s finest corporate houses including ICICI Bank and the National Stock Exchange. The MIG Club (where Sachin Tendulkar grew up) and the MCA Club (where Sachin now practices) are close by. This is an ideal location for people working in the area as well as people looking to be in close proximity to Bandra West - the queen of the Suburbs. The American International School and Arya Vidya Mandir are close by and work well for families with school-going children. The Kalanagar locality in particular is quiet, clean and safe which makes it a slightly nicer locality. The Bandra Station area offers homes at a budget for younger people wanting to party in Bandra West. Kurla on the other side of BKC has the large Kohinoor complex which offers safe community living with modern construction."')
